import React, { Component } from 'react';

class Logout extends Component {
    constructor(props){
        super(props);
        const removeAuth = sessionStorage.clear();
        this.props.history.push("/Home");
        console.log(removeAuth);
        console.log('Remove');
        if(removeAuth){
            this.props.history.push("/Home");
        }
    }
    render() {
        return (
            <div>
                Logout
            </div>
        );
    }
}

export default Logout;
